import React,{Component} from "react";
import {useState,useEffect} from 'react'
import Axios from 'axios'



function App(){

  const [getdata,setgetData]=useState([])
  useEffect(()=>{
    Axios.get('http://localhost:3001/posts').then((result)=>{setgetData(result.data)})
  },[])
        return(
            <div>
                <div>
                  {getdata.map((value=> {
                    return(
                      <div className="data">
                          <div className='id'><p>ID :</p> {value.id}</div>
                          <div className='title'><p>TITLE :</p> {value.title}</div>
                          <div className='description'><p>DESCTIPTION :</p> {value.description}</div>
                          <div className='username'><p>USERNAME :</p>{value.username}</div>
                      </div>
                    )

                    })
                  )}
                </div>
            </div>
        )

}


// export default App;
export default App;
